import ast
import json
import os
import unittest
from glob import glob

from sqlalchemy import create_engine
from werkzeug.exceptions import BadRequest, UnsupportedMediaType

from real_estate import app
from utility import Helper


class TestCase(unittest.TestCase):

    @classmethod
    def setUpClass(cls):
        # Create environment variables
        os.environ['TEST_SCHEMA'] = 'testing'
        os.environ['TEST_FOLDER'] = 'static/test'

        # Create testing images directory
        os.mkdir('static/test')

        # Create testing database structure
        db = create_engine("postgresql+psycopg2://root:password@database/docker")
        db.execute("CREATE SCHEMA testing;")
        db.execute(
            """
            CREATE SEQUENCE testing.listing_sequence
                start with 1
                increment 1;
            """)
        db.execute(
            """
            CREATE SEQUENCE testing.image_sequence
                start with 1
                increment 1;
            """)
        db.execute(
            """
            CREATE TABLE testing.listing
            (
                id INT PRIMARY KEY
                ,address VARCHAR(200)
                ,city VARCHAR(50)
                ,price NUMERIC
                ,coordinates geometry(GEOMETRY,4326)
                ,images TEXT[]
            );
            """)

    def setUp(self):
        self.app = app.test_client()

    @classmethod
    def tearDownClass(cls):
        # Remove environment variables
        del os.environ['TEST_SCHEMA']
        del os.environ['TEST_FOLDER']

        # Remove testing database structure
        db = create_engine("postgresql+psycopg2://root:password@database/docker")
        db.execute("DROP TABLE testing.listing;")
        db.execute("DROP SEQUENCE testing.image_sequence;")
        db.execute("DROP SEQUENCE testing.listing_sequence;")
        db.execute("DROP SCHEMA testing CASCADE;")

        # Remove testing images
        files = glob('./static/test/*')
        for file in files:
            os.remove(file)
        os.rmdir('static/test')

    def test_get_listings_200(self):
        res = self.app.get("/listings")
        self.assertEqual(200, res.status_code)

    def test_get_listings_200_page_and_limit(self):
        res = self.app.get("/listings?page=1&limit=10")
        self.assertEqual(200, res.status_code)

    def test_get_listings_200_range(self):
        res = self.app.get("/listings?lookup_mode=range&range=10&lat_from=40.5334&long_from=7.85645")
        self.assertEqual(200, res.status_code)

    def test_get_listings_200_city(self):
        res = self.app.get("/listings?lookup_mode=city&city=Torino")
        self.assertEqual(200, res.status_code)

    def test_get_listings_400_page_without_limit(self):
        res = self.app.get("/listings?page=1")
        self.assertEqual(400, res.status_code)

    def test_get_listings_400_city_without_city(self):
        res = self.app.get("/listings?lookup_mode=city")
        self.assertEqual(400, res.status_code)

    def test_get_listings_400_city_with_range_lat_long(self):
        res = self.app.get("/listings?lookup_mode=city&range=10&lat_from=40.5334&long_from=7.85645")
        self.assertEqual(400, res.status_code)

    def test_get_listings_400_range_without_range_lat_long(self):
        res = self.app.get("/listings?lookup_mode=range")
        self.assertEqual(400, res.status_code)

    def test_get_listings_400_range_with_city(self):
        res = self.app.get("/listings?lookup_mode=range&city=Torino")
        self.assertEqual(400, res.status_code)

    def test_get_listings_400_range_wrong_lat(self):
        res = self.app.get("/listings?lookup_mode=range&range=10&lat_from=foo&long_from=7.85645")
        self.assertEqual(400, res.status_code)

    def test_get_listings_400_range_wrong_min_lat(self):
        res = self.app.get("/listings?lookup_mode=range&range=10&lat_from=-100.1&long_from=7.85645")
        self.assertEqual(400, res.status_code)

    def test_get_listings_400_range_wrong_max_lat(self):
        res = self.app.get("/listings?lookup_mode=range&range=10&lat_from=100.1&long_from=7.85645")
        self.assertEqual(400, res.status_code)

    def test_get_listings_400_no_lookup_with_city(self):
        res = self.app.get("/listings?city=Torino")
        self.assertEqual(400, res.status_code)

    def test_get_listings_400_no_lookup_wrong_page(self):
        res = self.app.get("/listings?page=foo&limit=10")
        self.assertEqual(400, res.status_code)

    def test_get_listings_400_no_lookup_wrong_min_page(self):
        res = self.app.get("/listings?page=0&limit=10")
        self.assertEqual(400, res.status_code)

    def test_get_image_200(self):
        res = self.app.get("/image/1.jpg")
        self.assertEqual(200, res.status_code)

    def test_utility_validate_int_400_wrong_max_int(self):
        self.assertRaises(BadRequest, Helper.validate_int, "4", 1, 2)

    def test_utility_is_base64_false(self):
        self.assertFalse(Helper.is_base64('foo'))

    def test_utility_validate_image_400_wrong_content(self):
        self.assertRaises(BadRequest, Helper.validate_image, "foo", {'png'}, 1)

    def test_utility_validate_image_400_wrong_extension(self):
        self.assertRaises(UnsupportedMediaType, Helper.validate_image,
                          "",
                          {'png'}, 1)

    def test_utility_validate_image_400_wrong_size(self):
        self.assertRaises(BadRequest, Helper.validate_image,
                          "",
                          {'jpeg'}, 1)

    def test_post_listing_200(self):
        payload = {
            "address": "Via Montebello, 20, 10124 Torino TO",
            "city": "Torino",
            "coordinates": [
                "45.0700962", "7.6700891"
            ],
            "images": [
                ""
            ],
            "price": 1252950.0
        }
        response = self.app.post("/listing", headers={"Content-Type": "application/json"}, data=json.dumps(payload))

        # HTTP status 200
        self.assertEqual(response.status_code, 200)

        response_data = ast.literal_eval(response.data.decode("UTF-8"))

        # Validate fields equality
        self.assertEqual(response_data['address'], payload['address'])
        self.assertEqual(response_data['city'], payload['city'])
        self.assertEqual(response_data['coordinates'], payload['coordinates'])

        # Check data types
        self.assertEqual(len(response_data['coordinates']), 2)
        self.assertEqual(type(response_data['id']), int)
        self.assertEqual(type(response_data['price']), float)
        self.assertEqual(type(response_data['images']), list)
        self.assertEqual(len(response_data['images']), 1)

